import { Navbar } from "./Navbar";

const Head = () => {
    return (
        <>
        <section className="head">
            <div className="head">
                <h1>Mercado Free</h1>
                <Search></Search>
                <Navbar></Navbar>
            </div>
        </section>
        
        <section className="carrusell">
            <Slideshow></Slideshow>
        </section>
        </>
    );
}

export default Head
